import React from 'react'
import { TimeSeries } from "pondjs";
import { Charts, ChartContainer, ChartRow, YAxis, LineChart } from "react-timeseries-charts";

const TimeGraph = () =>{
    const data = {
        columns: ["time", "value"],
        points: [
            [1636723884456, 52],
            [1639587884456, 18],
            [1640451884456, 26],
            [1641315884456, 93],
        ]
    };
    const timeseries = new TimeSeries(data);
    return(
        <div>
            <ChartContainer timeRange={timeseries.timerange()} width={360} padding={5} format="month">
                <ChartRow height={100}>
                    <YAxis id="axis1" format="$.2f" label="Stock Price" width="40" type="linear" min={timeseries.min()} max={timeseries.max()}/>
                    <Charts>
                        <LineChart axis="axis1" series={timeseries}/>
                    </Charts>
                </ChartRow>
            </ChartContainer>
        </div>
    )
}
export default TimeGraph
